webpackJsonp([0x5d73a7200918],{7442:function(e,t){e.exports={data:{post:{html:"<p>You know there's some serious action going on under the covers when politicians hide from the press. That's currently the case here, where 3 weeks after the election the Union and SPD are now meeting secretly \"under 8 eyes\" to hammer out the framework of a grand coalition. There's still some squawking coming from the understudies, but the main players are <a href=\"http://news.bbc.co.uk/2/hi/europe/4325600.stm\">keeping their mouths shut</a>. </p>\n<p>The press thinks it knows what the cabinet could look like... Merkel as Chancellor, SPD with 8 ministries. Whether Schr√∂der can get over his ego to be Vice-Chancellor and Foreign Minister remains to be seen (my guess is no). But once they start talking to the press again, we'll know they're done. Maybe today.</p>",fields:{title:"Mum's The Word",date:"10 Oct 2005",url:"https://papascott.de/2005-10-10-mums-the-word/"}}},pathContext:{slug:"/2005-10-10-mums-the-word/",prev:{fields:{title:"Die fremde Braut",date:"09 Oct 2005",slug:"/2005-10-09-die-fremde-braut/"}},next:{fields:{title:"m0n0wall 1.2",date:"11 Oct 2005",slug:"/2005-10-11-m0n0wall-12/"}}}}}});
